//////////////////////////////////////////////////////////////////////
// Purpose: Footer Component
// Author: Siddharth Karanchery
//////////////////////////////////////////////////////////////////////

import React, { useState } from "react";

import "./Footer.css";

function Footer() {
  return (
    <div className="Footer">
      <div className="Footer__columns">
        <div className="Footer__columns__column" id="Footer__logo">
          Logo
        </div>
        <div className="Footer__columns__column">
          About Us Terms & Condition Customer Support Privacy Policy Sitemap
        </div>
        <div className="Footer__columns__column">Column 1</div>
      </div>

      <div className="Footer__row">
        Copyrights 2021 BetterMart.com All rights reserved.
      </div>
    </div>
  );
}
export default Footer;
